    description:
      'A **Fusion by nstech** é uma empresa especializada em soluções tecnológicas para o setor logístico, oferecendo ferramentas inovadoras que otimizam processos e melhoram a eficiência operacional de transportadoras e embarcadores. Nossa plataforma integra diversas funcionalidades, incluindo roteirização inteligente, rastreamento de frotas e gestão de entregas, garantindo mais agilidade, segurança e redução de custos para nossos clientes.\n\n  \n\nDa roteirização à entrega final, automatizamos processos com alta precisão, aumentamos a produtividade e reduzimos custos para embarcadores. Nossa plataforma web fornecida em SaaS revoluciona o setor logístico. O “como fazer” é o que nos diferencia, e isso reflete diretamente nas métricas da operação.\n\n  \n\nEstamos em busca de um **Desenvolvedor Fullstack Sr para atuar com PHP e node.js** em projetos de desenvolvimentos de novas features para as nossas aplicações.\n\n  \n\nSe você busca trabalhar em uma empresa inovadora, que valoriza a tecnologia e a evolução contínua, a **Fusion by nstech** é o lugar ideal para você! Aqui, você terá a oportunidade de atuar em projetos desafiadores, utilizando as mais modernas ferramentas do mercado e contribuindo diretamente para o crescimento e transformação digital da logística no Brasil.  \n\n\n\n  \n\n  \n\n**Responsabilidades e atribuições**  \n\n* Desenvolver, testar e implementar soluções web, com foco em PHP e node.js;\n* Trabalhar com bancos de dados, relacionais e não relacionais;\n* Criar e manter testes automatizados, de unidade e integração;\n* Propor soluções e implementações com uso de container e orquestradores;\n* Realizar integrações entre diferentes fontes de dados;\n* Trabalhar na analise de funcionalidades para a proposta de desenvolvimento de novos projetos;\n* Garantir a entrega das demandas de acordo com os requisitos e prazos estabelecidos;\n* Realizar a manutenção de sistemas existentes, otimizando sua performance e funcionalidade;\n* Participar dos ritos da metodologia ágil com equipe e reuniões com áreas de negócio para eventuais dúvidas;\n* Acompanhar e assegurar o progresso das etapas do projeto conforme o cronograma;\n* Manter\\-se atualizado sobre novas tecnologias e tendências de mercado para implementar inovações.\n\n  \n\n**Requisitos e qualificações** **Principais requisitos:**\n\n* Conhecimentos sólidos em PHP e SQL\n* Atuar desenvolvendo em back\\-end (servidor, banco de dados, modelagem, programação, estruturação de dados e implementação)\n* Front\\-end (interface, UX, corte). Estes desenvolvimentos podem ser correções de BUGs, criação de novas funcionalidades ou análise do código fonte para explanações das regras de negócio já implementadas.\n* Atuar com as ferramentas de desenvolvimento (IDEs, ferramentas de gestão de projetos, soluções de gerência de códigos fontes Bitbucket).\n* Escrever comandos SQLs no SGBD MySQL e PostgreSQL.\n\n **O que esperamos de você:**\n\n* Honestidade, compromisso, respeito, empatia, confiabilidade, eficiência e humildade em aprender.\n\n  \n\n**Informações adicionais** **O que esperamos de você:**\n\n  \n\nNa Fusion by nstech, temos uma cultura baseada em valores e esperamos que todos os nstechers não apenas se identifiquem, mas também vivam essa cultura em seu dia a dia.\n\n  \n\nAcreditamos que a cultura é uma das maiores vantagens competitivas para negócios bem\\-sucedidos, pois é algo que não pode ser copiado integralmente.\n\n  \n\nNossos pilares culturais e seus atributos são:\n\n* Servir: foco no cliente, humildade, transparência e ética;\n* Equipe: valorizamos o trabalho em equipe, a vontade de colocar a mão na massa e o espírito colaborativo;\n* Resultados: buscamos agilidade, melhoria contínua, geração de valor a longo prazo e foco nos resultados.\n\n#### **JUNTE\\-SE A NÓS!**\n\nSomos nstech, a mais completa plataforma open logistics do mundo e estamos construindo o futuro digital do transporte de cargas junto a todo o ecossistema logístico. Nosso objetivo é impactar a sociedade de forma positiva, reduzindo a poluição, o trânsito, as mortes nas estradas e os custos logísticos. Além disso, impulsionamos o crescimento econômico, a equidade salarial, a diversidade e o desenvolvimento pessoal e profissional.\n\n  \n\nPensamos grande e temos um sonho ousado: melhorar o mundo através da tecnologia para logística e mobilidade. Já estamos presentes em 11 países \\- Brasil, EUA, México, Colômbia, Peru, Equador, Bolívia, Chile, Argentina, Portugal, Angola \\- e continuamos expandindo nosso impacto pelo mundo.\n\n  \n\nAo se juntar à nstech, você fará parte de uma equipe apaixonada por **inovação**, **tecnologia** e **transformação**. Terá a oportunidade de trabalhar em **projetos desafiadores** e de **grande escala**, colaborando com profissionais talentosos e diversificados. Aqui, valorizamos o aprendizado contínuo, o crescimento profissional e o ambiente de trabalho colaborativo.\n\n  \n\nSe você está em busca de um ambiente dinâmico, onde suas habilidades e paixão pela tecnologia podem fazer a diferença, venha ser nstecher e fazer parte da construção do futuro da logística e mobilidade!\n\n **CERTIFICAÇÃO QMS:** A nstech é certificada pelo Selo ESG de Negócio Sustentável. Esse registro destaca empresas que oferecem benefícios sociais e ambientais e atuam efetivamente na construção de um sistema econômico mais inclusivo, equitativo e regenerativo para as pessoas e para o planeta.\n\n  \n\nA Fusion Software e Serviços S/A é um empresa de Tecnologia especializada em soluções inovadoras e focada na logística de entregas. Nosso software web fornecido em SaaS traz um conceito inovador denominado "DMS" ou "Sistema de Gerenciamento de Entregas", composto por 07 módulos totalmente integrados com mais de 30 ERP\'s do mercado. Somos a mais completa solução especialista em gestão de entregas do Brasil.\n\n',
