    description:
      'Na Global Hitss, a inovação é o nosso combustível, a curiosidade é o nosso motor e o respeito pelo cliente é o nosso guia. Se você é movido pela paixão em criar soluções tecnológicas disruptivas, se busca constantemente desafios que ampliem os limites do possível e se acredita que colocar o cliente em primeiro lugar é a chave para o sucesso, então você está no lugar certo.\n\n  \n\nQueremos pessoas que se destaquem, que pensem fora da caixa e estejam dispostas a desbravar novos horizontes. Aqui, cada ideia é valorizada, cada pergunta é incentivada e cada desafio é encarado como uma oportunidade de aprendizado e crescimento.\n\n  \n\nJunte\\-se a nós e faça parte de uma cultura vibrante, onde a inovação é alimentada pela curiosidade incessante e onde o respeito pelo cliente permeia todas as nossas ações. Aqui, você terá a liberdade de explorar suas habilidades, colaborar com mentes brilhantes e transformar o futuro da tecnologia.\n\n  \n\nSe você está pronto para fazer parte de uma empresa que acredita que o talento é a chave para o sucesso, envie seu currículo e junte\\-se à nossa equipe.\n\n  \n\nEstamos ansiosos para conhecer você e impulsionar juntos a próxima geração de soluções tecnológicas.\n\n**Venha ser um Hit!**\n\n **Responsabilidades e atribuições**  \n\n* Sustentação de sistemas na linguagem Delphi;\n* Desenvolvimento de features no sistema, seguindo requisitos definidos na atividade;\n* Garantia de qualidade nas atividades desenvolvidas;\n* Versionamento adequado da aplicação;\n* Reporte do status das atividades para o gestor.\n\n **Requisitos e qualificações**  \n\n* Graduação na área de TI, ou qualquer área de formação acrescido de diploma de pós\\-graduação na área de Tecnologia;\n* Experiência de desenvolvimento na linguagem Delphi;\n* Conhecimento avançado em consultas a banco de dados Oracle, incluindo criação e manutenção de procedures;\n* Experiência com testes de unidade, integração e funcionais;\n* Familiaridade com versionamento no GitLab;\n* Experiência em utilização de APIs REST;\n* Conhecimento em ODAC;\n* Quick Report...\n\n **Informações adicionais**  \n\nQuer conhecer todas as nossas vagas? Acesse a nossa página:\n\n\nGlobal Hitss \\- Trabalhe Conosco\n\n\nhttps://globalhitss.gupy.io/\n\n **Importante: Todas as nossas vagas são elegíveis para profissionais com deficiência, equidade de gênero e raça/ etnia.**\n\n  \n\nA HITSS BRASIL é uma multinacional do grupo América Móvil, atuando há mais de 30 anos no mercado de soluções digitais e serviços de TI em 7 países. Combinando experiência incomparável e habilidades especializadas, nossos 5\\.000 colaboradores estão engajados em fazer o novo todos os dias. Apostamos em inovação com integridade e buscamos desenvolver soluções inclusivas, responsáveis e sustentáveis para atender nossos funcionários e clientes.\n\n **Por meio do pilar de diversidade e inclusão, todos têm oportunidades iguais de construir sua carreira.**\n\n\nNão fazemos distinção de gênero, religião, raça, orientação sexual, posição social e deficiência.\n\n\nSe você gosta de desafios, tendências, processos ágeis e inovadores, seu lugar é aqui.\n\n  \n\nJunte\\-se a nós!\n\n',
