    description:
      'Destinado a pessoas que atuam como Desenvolvedor(a) de Software Sênior que estejam pronto(a)s para enfrentar desafios complexos e contribuir significativamente para projetos de Engenharia de Software, Arquitetura de Sistemas e Inovação Tecnológica em uma empresa com crescimento acelerado e dinâmico. Se você tem paixão por desenvolver soluções que geram valor real para os negócios, seu lugar é na Visagio!\n\n  \n\nNosso time atua em todas as fases do ciclo de vida do desenvolvimento, desde a concepção da solução até a entrega final, incluindo a evolução de sistemas. Valorizamos um ambiente ágil, colaborativo e não\\-hierárquico, onde você terá a oportunidade de trabalhar com um grupo talentoso e apaixonado por transformação digital.\n\n  \n\nSe você está pronto(a) para dar o próximo passo na sua carreira em um ambiente estimulante e inovador, não hesite em se inscrever!\n\n  \n\nEsta vaga é destinada ao **banco de talentos,** então seu currículo será guardado por nosso time e **assim que surgir alguma oportunidade que encaixe com o seu perfil, entraremos em contato!**\n\n **Responsabilidades e atribuições**  \n\n* Liderar o desenvolvimento de soluções complexas, contribuindo em diversas frentes de tecnologia;\n* Participar da análise e definição das melhores tecnologias e arquiteturas a serem utilizadas nos projetos;\n* Implementar novas ferramentas, técnicas e metodologias para otimizar o processo de desenvolvimento;\n* Compartilhar conhecimento e mentorar membros do time, promovendo um ambiente de aprendizado e crescimento;\n* Colaborar com equipes multidisciplinares para garantir a entrega de soluções de alta qualidade.\n\n **Requisitos e qualificações**  \n\n* Experiência sólida em desenvolvimento de software;\n* Conhecimento avançado em metodologias ágeis, padrões de projeto e arquitetura de sistemas;\n* Domínio dos paradigmas de programação mais comuns;\n* Capacidade de trabalhar em ambientes dinâmicos e desafiadores, com foco na entrega de resultados;\n* Habilidade de comunicação e trabalho em equipe, com disposição para colaborar e compartilhar conhecimentos;\n* Desejável conhecimento avançado da língua inglesa;\n* Desejável domínio e utilização de ferramentas de IA para aumento de produtividade e realização de tarefas em massa.\n\n **Informações adicionais**  \n\nSomos uma empresa do Grupo Visagio focada em desenvolver soluções digitais de alto impacto que transformam e evoluem o negócio de nossos clientes. Através de um ambiente de alta dinamicidade e engajamento com propósito, missão e cultura genuínos, buscamos pessoas apaixonadas por resolver problemas complexos por meio de inovação e tecnologia.\n\n  \n\nAqui estamos comprometidos com a diversidade e inclusão em todas as áreas de nosso negócio. Valorizamos a diversidade de pensamento, perspectivas e experiências em nosso local de trabalho. Comprometemo\\-nos a criar um ambiente de trabalho inclusivo e justo para todos, independentemente de sua origem geográfica, raça, etnia, idade, gênero, orientação sexual, ou deficiência, para que possam contribuir com todo o seu potencial.\n\n  \n\nSe você busca realizar feitos grandiosos em um ambiente colaborativo e de crescimento acelerado, seu lugar é aqui!\n\n  \n\nPara nos conhecer um pouco mais, acesse o nosso site: http://www.v\\-dev.io\n\n',
