    description:
      'Estamos com uma oportunidade para uma pessoa Desenvolvedora Java.\n\n  \n\nPara esse desafio, o(a) Dev atuará com *\\[****backlog receptivo*** *(pequenas melhorias), garantindo qualidade no código e segurança nas aplicações ;* ***projetos grandes****, envolvendo refatoração, melhora na usabilidade do sistema, otimização de processos, garantindo a qualidade e melhor posicionamento do nosso produto;* ***manutenção****, garantindo o funcionamento do sistema, corrigindo erros, eventualmente melhorando a performance do que já existe e fazendo adequações de maneira objetiva, agregando valor ao que o usuário espera]*.\n\n **Topa o desafio?**\n\n\n\\#wewantyou\n\n  \n\nNosso **\\#Tech Team** é um dos times chaves que fazem acontecer dentro da Sankhya. Por causa desta galera cheia de criatividade e, com **muita sede de desenvolvimento (literalmente)**, oferecemos cada dia mais um software completo interativo que guia nossos clientes com muita inovação e gestão inteligente!\n\n  \n\nAqui na Sankhya buscamos novas formas de solução, que sejam menos complexas, autênticas e únicas. E com isso **queremos pessoas que desejem crescer** a cada dia junto com a empresa, ajudando a gente a construir cada vez mais um ambiente diverso e de **crescimento acelerado**.\n\n **Responsabilidades e atribuições**  \n\n* Desenvolver rotinas em Java integradas ao sistema Sankhya\\-Om.\n* Criar integrações entre sistemas distintos.\n* Desenvolver extensões.\n* Desenvolvimento back end e front end.\n* Implementar campos adicionais e botões de ação utilizando PL/SQL.\n* Desenvolver ações agendadas e triggers de validação simples com transformação de dados.\n* Criar dashboards e relatórios personalizados para atender às necessidades dos clientes.\n\n  \n\n**Requisitos e qualificações**  \n\n* Graduação completa em Ciência da Computação, Sistemas de Informação, Engenharia da Computação ou áreas afins.\n* Interesse em se desenvolver na área de negócios.\n* Conhecimento em banco de dados e aplicações.\n* Conhecimento em Consumo de API (API Consumer);\n* Conhecimento em Exposição de API (API Provider);\n* Exposição: Sua aplicação fornece APIs para que outras aplicações ou sistemas possam interagir com ela.\n* Experiência em desenvolvimento com Java e PL/SQL.\n* Desejável conhecimento em HTML5, jQuery e Angular.\n\n  \n\n**Informações adicionais**  \n\nAqui na Sankhya, nós prezamos muito pelo equilíbrio entre o lado humano, que envolve profissional e pessoal. Sabemos que tudo hoje é interligado e, no fim das contas, **é tudo sobre gente.** Por isso, nossos benefícios são personalizados para Sankhers, confira!\n\n  \n\nO que a Sankhya te oferece:\n\n  \n\nPlano de saúde\n\n\nPlano odontológico\n\n\nKit Baby Sankher\n\n\nAuxílio\\-creche\n\n\nTotalpass (academias)\n\n\nPrêmio Indicações de talentos e clientes premiadas\n\n\nMassoterapia no escritório\n\n\nSeguro de Vida\n\n\nVale\\-alimentação/refeição Swile\n\n\nBenefício Flex\n\n\nVale\\-transporte\n\n\nDia da Fruta\n\n\nConfraternizações Exclusivas\n\n\nUniversidade corporativas\n\n **E MAIS IMPORTANTE AINDA:**\n\n\nTodas as nossas vagas estão disponíveis para pessoas com deficiência!\n\n  \n\nEstá esperando o que pra fazer parte de nosso time?\n\n  \n\n\\#VemserSankhya!\n\n  \n\nFundada em 1989, somos líder no mercado brasileiro de soluções integradas de gestão corporativa (ERP). Com mais de 2000 colaboradores e atendendo cerca de 20 mil clientes em todos os 26 estados do país, oferecemos o ERP Sankhya, uma solução completa que permite acesso em tempo real aos detalhes do negócio, impulsionando eficiência e agilidade na gestão.\n\n **Nosso propósito é claro:** transformar a sociedade através da gestão, combinando excelência tecnológica com o poder transformador das pessoas. Nossa cultura é enraizada na base familiar e incentivadora do protagonismo e da inovação.\n\n **Acreditamos firmemente que ter as pessoas certas ocupando as posições adequadas não só impulsiona a felicidade e o engajamento no ambiente de trabalho, mas também resulta em melhorias substanciais em nossos negócios e estimula a inovação.**\n\n',
