      '**Description:**\n----------------\n\n\nEstamos em busca de um Desenvolvedor Front End Pleno para integrar nosso time.\n\n\nA Degrau conta hoje com 40 colaboradores e tem perfil bem descontraído. Nossa equipe é bastante unida e os profissionais costumam ficar por muitos anos conosco, então se você tem esse perfil, já é um ótimo começo.\n\n\nSe você é apaixonado por desenvolvimento web e quer atuar em uma agência dinâmica e inovadora, essa oportunidade é para você! Buscamos um profissional que domine HTML5, CSS3 e Javascript com experiência em desenvolvimento de interfaces modernas, responsivas e otimizadas para performance. Conhecimento em Wordpress, React, React\\-native e Node são muito bem\\-vindas.\n\n\nSegue abaixo um resumo dessa vaga:\n\n**Responsabilidades**\n\n* Desenvolver e manter sites e aplicações web responsivas utilizando HTML, CSS e JS.\n* Desenvolvimento e manutenção de projetos em Wordpress e React.\n* Integrar APIs e serviços de terceiros em aplicações front end.\n* Desenvolver interfaces dinâmicas e intuitivas alinhadas às melhores práticas de UX/UI.\n* Familiaridade com ferramentas de versionamento de código Git/GitHub.\n* Colaborar com designers e equipes de marketing para transformar layouts em código funcional.\n* Otimizar o desempenho de sites e aplicações para garantir performance e acessibilidade.\n* Desenvolvimento e manutenção de projetos em Wordpress e React.\n* Garantir compatibilidade entre navegadores e dispositivos.\n* Participar de reuniões estratégicas e contribuir com soluções inovadoras para os projetos.\n\n**O que esperamos**\n\n* Perfil: Pleno;\n* Experiência comprovada em front\\-end.\n* Conhecimento em JavaScript ES6\\+ e boas práticas de desenvolvimento.\n* Experiência com o pré\\-processador SASS.\n* Familiaridade com metodologias ágeis (Scrum/Kanban).\n* Noções de SEO técnico para desenvolvimento web.\n* Organização, proatividade e habilidade para trabalhar em equipe.\n* Capacidade de gerenciar múltiplos projetos simultaneamente.\n\n**Diferenciais**\n\n* Experiência com Node, Next.js, Angular e frameworks modernos de desenvolvimento web.\n* Conhecimento em Figma ou Adobe XD para interpretação de layouts.\n* Experiência em agências de publicidade ou ambiente de alta demanda de projetos.\n* Experiência com PHP para ajustes em projetos Wordpress.\n\n**Benefícios que oferecemos**\n\n\nA Degrau tem um ambiente descontraído e uma equipe que valoriza inovação e crescimento profissional. Queremos pessoas que gostem de desafios e busquem evolução constante!\n\n\nNosso pacote de benefícios inclui:\n\n* Salário competitivo;\n* Contratação em regime CLT ou PJ;\n* CLT: Plano de saúde \\+ seguro de vida \\+ VR;\n* Home office;\n* Encontros mensais em coworkings (apenas para residentes de São Paulo);\n* Horário flexível;\n* Subsídio para treinamentos e cursos;\n* Planos de desenvolvimento;\n* Ambiente de trabalho descontraído;\n* Day off de aniversário (opcional);\n* TotalPass (academias conveniadas);\n* Acesso a plataforma de saúde digital, com direito a psicólogo, nutricionista e telemedicina.\n\n\n**Requirements:**\n-----------------\n\n',
