    description:
      '**Estamos buscando um(a) desenvolvedor(a) backend pleno para trabalhar com C\\#, TypeScript,** **Node.js** **e** **React.js**\n\n **SOBRE NÓS:**\n\n  \n\nA Leapfone (www.leapfone.com.br) é uma startup de celular por assinatura com a missão de possibilitar que mais brasileiros tenham acesso a smartphones poderosos. Somos incubados pela Pitzi, uma das principais empresas de proteção para celulares do Brasil com 10 anos de história e mais de 2 milhões de aparelhos protegidos.\n\n  \n\nA Pitzi (www.pitzi.com.br) é certificada pela consultoria global "Great Place to Work" como uma das melhores empresas para se trabalhar. Além disso, nossos investidores, Kaszek, QED, DCM, Flybridge, Valiant Partners, Thrive Capital e WTI são os mesmos de startups admiradas como Nubank, QuintoAndar, GuiaBolso, Uber, Facebook, Instagram, Dropbox e muitas outras.\n\n  \n\nNosso time é formado por um grupo de pessoas apaixonadas por simplicidade, design e tecnologia. Gostamos de colocar coisas bem\\-feitas e bem pensadas na rua e desejamos criar um produto sensacional. Acreditamos em liberdade com responsabilidade e promovemos um ambiente leve no qual todos trabalham com autonomia.\n\n  \n\nTemos planos bastante ambiciosos de crescimento para a Leapfone. Quem fizer parte do time vai participar da evolução do negócio desde o início e terá a possibilidade de crescer junto conosco!\n\n **﻿Contratação PJ \\+ Benefícios:**\n\n* Uma folga no mês de aniversário;\n* Eventos de descompressão na sexta\\-feira;\n* Gympass;\n* TotalPass;\n* Auxílio Creche;\n* Ginástica Laboral e Quick Massage\n* Bônus anual;\n* Licença maternidade estendida 180 dias;\n* Licença paternidade estendida 30 dias;\n* Licença parental estendida 120 dias;\n* Proteção total Pitzi;\n* Facilitação na adesão Leapfone;\n* Facilitação na adesão de celular e produtos Pitzi;\n* Pitzi Academy – cursos focados no desenvolvimento de soft skills e hard skills\n\n **Responsabilidades e atribuições**  \n\nEssa vaga é para alguém que deseja se envolver ativamente com o desenvolvimento do negócio, trabalhando de forma colaborativa com os outros desenvolvedores e com os times de design, produto e operações para criar uma experiência impecável para os usuários. Você vai participar ativamente de todo o processo: da ideação ao delivery de novas funcionalidades.\n\n  \n\nTrabalhamos com:\n\n* C\\#\n* Typescript\n* Node.js\n* React.js\n* GraphQL\n* Docker\n* GitLab CI/CD\n* Infraestrutura AWS\n* Testes Automatizados\n* Bancos de dados relacionais e documentais\n\n  \n\nNossas práticas:\n\n* Procuramos escrever código limpo (fácil de entender, modificar, estender e testar)\n* Buscamos melhoria contínua no código e no produto\n* Fazemos Code Review por Pull Requests (PR)\n* Utilizamos DDD (Domain Driven Design) e BFF (Backend for Frontend)\n\n **Requisitos e qualificações*** Experiência anterior como desenvolvedor Node.js / TypeScript / C\\#\n* Conhecimento intermediário em Node.js e Javascript\n* Familiaridade com Typescript\n* Familiaridade ou experiência com frameworks de teste e performance\n* Conhecimento básico em Linux, NPM e Git\n* Boas habilidades em solução de problemas\n* Boas habilidades interpessoais\n* Inglês intermediário\n\n **A Pitzi nasceu em 2012 com a missão de revolucionar o mercado de proteção para celular no Brasil.**\n\n  \n\nAo lado de varejistas parceiros, oferecemos a proteção de celular mais completa do mercado, com transparência e velocidade. Utilizamos tecnologia de ponta e uma abordagem inovadora para simplificar o processo de contratação e gerenciamento de proteção para smartphones, proporcionando uma experiência ímpar e totalmente digital aos clientes.\n\n  \n\nSão mais de 2 milhões de aparelhos protegidos, 2 mil pontos de vendas em todo o país e 150 Pitziers apaixonados por inovação.  \n\n\n\n  \n\nPessoas, transparência e tecnologia. Esse é o nosso combustível.\n\n',
