      '**Nossa Oportunidade**\n\nEstamos à procura de **Desenvolvedor/Desenvolvedora** **Mainframe** para integrar a nossa equipe capaz de garantir que os sistemas críticos das empresas funcionem de maneira eficiente e segura. Se você é uma pessoa talentosa e apaixonada por tecnologia que procura uma função híbrida dinâmica, então somos o lugar para você.\n\n\n.\n\n\nNossa oportunidade é Remota com jornada de trabalho flexível (40 horas semanais) e o modelo de contratação é CLT.  \n\n* \n\n**.** **Atividades:**\n\n* Desenvolvimento e Manutenção de Aplicações: Escrever, testar e manter programas em linguagens como COBOL, PL/I, ou Assembler.\n* Gestão de Dados: Trabalhar com bancos de dados como DB2 e sistemas de arquivos como VSAM.\n* Automação de Processos: Criar e gerenciar scripts de JCL (Job Control Language) para automatizar tarefas e processos.\n* Integração de Sistemas: Integrar aplicações mainframe com outros sistemas e plataformas, utilizando tecnologias como CICS para transações online.\n* Monitoramento e Performance: Utilizar ferramentas como Control\\-M para monitorar e otimizar a performance dos sistemas.\n* Gerenciamento de Mudanças: Utilizar ferramentas como Changeman para controlar versões e mudanças no código.\nSuporte e Solução de Problemas: Diagnosticar e resolver problemas técnicos, garantindo a continuidade dos serviços.  \n* \n\n**.** **O perfil que buscamos:**\n\n* Experiência como Analista Desenvolvedor COBOL Mainframe.\n* Conhecimentos em análise e desenvolvimento com COBOL, CICS, DB2, JCL, Control\\-M (batch e online).\n* Sólidos conhecimentos em lógica de programação.\n* Banco de Dados Relacional Mainframe (DB2, Z/OS).\nFortes habilidades de comunicação.  \n* \n\n  \n\n**Requisitos Desejáveis:**\n\n* Experiência com metodologias ágeis (Agile).\nExperiência no setor bancário.  \n* \n\n  \n\n**Diferenciais:**\n\n* Conhecimento em elementos de arquitetura de sistemas bancários.\nConhecimento na ferramenta Hexavision.  \n* \n\n**Get the future you want**\n\nPor meio de uma força de trabalho diversificada que representa nossa sociedade promovemos uma **cultura inclusiva** , construindo um lugar onde nossos talentos são acompanhados por líderes transformacionais e equipes altamente engajadas. Através do **SejaVocê@Capgemini** expressamos o nosso compromisso em compreender continuamente as características e interesses que tornam cada uma das nossas pessoas únicas. Nos orgulhamos da nossa diversidade e estamos empenhados em promover um ambiente inclusivo e com equidade de oportunidades. Nossas vagas, são para todas as pessoas ***independente de cor, etnia, religião, idade, identidade de gênero, orientação sexual ou deficiência.***\n\nSomos reconhecidos pela GPTW como um ótimo lugar para trabalhar e uma das 10 melhores empresas para mulheres trabalharem no Brasil. Nosso compromisso com Equidade de Gênero também foi reconhecido pela Bloomberg pelo segundo ano consecutivo e somos certificados pela Edge e Edge Plus também focada em equidade de gênero. Além de estarmos no 11º ano consecutivo pelo Instituto Ethispere como uma das Empresas Mais Éticas do Mundo.  \n\n\n\n**Aqui você pode ser quem você é:** Protagonista do seu desenvolvimento com oportunidades de aprendizagem, crescimento e atuação em projetos desafiadores.  \n\n\n\nAlém disso temos a preocupação em oferecer pacote de remuneração e benefícios competitivos no segmento, reconhecendo as competências, performance individual e de equipe. Voltados para o seu **Bem\\-estar Físico, Emocional, Financeiro** e **Familiar** .  \n\n\n\n* **Pacote de Benefício** s: Assistência Médica, Telemedicina Einstein Conecta, Plano Odontológico, Convênio Farmácia, Acesso a plataformas de saúde física e mental (Gympass e Equilibrium), Vale Refeição, Seguro de Vida, Previdência Privada, Auxílio Home Office, Empréstimo consignado, Plano de Participação Acionária, Clube de benefícios e muito mais!\n\n* **Plano de carreira** que incentiva sua jornada e desenvolvimento, proporcionando visibilidade de forma clara sobre as oportunidades de carreira e os requisitos necessários para o seu próximo nível.\n\n* **Universidade Corporativa e Learning Hub** : Aqui você constrói a sua própria trilha de desenvolvimento com uma formação dinâmica e acelerada. Terá acesso gratuitamente a cursos disponíveis parceiros de alto nível para aprimorar suas habilidades técnicas e comportamentais. Além de contar com plataformas de ensino reconhecidas como Harvard Manage Mentor, Coursera, Udemy e Pluralsight.\n\n* **Acesso a certificações oficiais** com nossos parceiros como: AI Breakthrough award, AWS, Avasant, CDP “A” list, Ecovadis, Everest, Ethisphere, Gartner, IDC Google, Microsoft, SAP, Salesforce, ServiceNow e muito mais.\n\n* **Através da EF Education First** (English Live Brasil): Você terá acesso a plataforma on line, com aulas adaptadas ao seu nível para se desenvolver nos idiomas: Inglês, Espanhol, Francês e Alemão.\n\n**Sobre a Capgemini**\n\nA Capgemini é líder global em parceria com empresas para transformar e gerenciar negócios, aproveitando o poder da tecnologia, desde estratégia e design até operações, alimentadas pelo mundo inovador e em rápida evolução da nuvem, dados, IA, conectividade, software, engenharia digital e plataformas  \n\n\n\nContamos com mais de 360\\.000 profissionais presentes em mais de 50 países, em 2023 o Grupo reportou receitas globais de € 22,5 bilhões.  \n\n\n\nSomos guiados diariamente pelo propósito de liberar a energia humana por meio da tecnologia para um futuro inclusivo e sustentável e por nossos sete valores: ***Honestidade, Audácia, Confiança, Liberdade, Espírito de equipe, Modéstia e Fun*** . Se você compartilha dos mesmos valores, aqui é o seu lugar!\n\n',
