    description:
      '**Descrição:**\n\n\nO Dev. Python para Ingestão de Dados será responsável pelo desenvolvimento e manutenção de endpoints de APIs para conectar fontes de dados heterogêneas. Este profissional deverá garantir que o fluxo de dados seja eficiente, seguro e escalável, utilizando frameworks de APIs e tecnologias de cloud, especialmente no ambiente GCP. O cargo é vital para assegurar que os dados fluam de maneira contínua e que as integrações sejam robustas e escaláveis.\n\n **Funções e Responsabilidades:**\n\n* Desenvolver e manter endpoints de APIs para ingestão de dados a partir de fontes variadas (APIs, arquivos, bancos de dados, etc.);\n* Garantir a integração eficiente dos dados com as plataformas da empresa, utilizando GCP e frameworks de APIs;\n* Implementar soluções para monitoramento e validação dos dados ingeridos;\n* Colaborar com equipes de engenharia e dados para desenvolver soluções escaláveis;\n* Realizar deploy de endpoints e monitoramento contínuo de performance e segurança;\n* Garantir a documentação técnica completa de todos os endpoints e fluxos de ingestão;\n* Trabalhar com pipelines de dados automatizados para garantir a integração contínua e sem falhas.\n\n **Requisitos:**\n\n* Python avançado;\n* Desenvolvimento de APIs e integração de dados Frameworks de APIs (Flask, FastAPI, etc.);\n* Experiência com deploy de endpoints Conhecimento em GCP (Cloud Functions, Pub/Sub, Dataflow);\n* Familiaridade com boas práticas de ingestão de dados;\n* Experiência com automação de pipelines de dados;\n* Capacidade de resolução de problemas complexos;\n* Proatividade e habilidades de auto\\-organização;\n* Excelente comunicação para trabalhar em equipes multidisciplinares;\n* Capacidade de aprender e adaptar\\-se rapidamente;\n* Foco em qualidade e atenção aos detalhes.\n',
