      '*Na Premiersoft, transformamos desafios em soluções. Com mais de uma década de pioneirismo em desenvolvimento mobile, somos movidos por um propósito claro: criar experiências tecnológicas que impulsionam o crescimento e a transformação dos nossos clientes. Nosso time, formado por mais de 200 \\#Heroes, combina expertise técnica com o nosso DNA:* ***Team Player****,* ***Growth Driven*** *e* ***Problem Solver****. Somos movidos por desafios, focados na inovação e comprometidos com a excelência em tudo o que fazemos.*\n\n\n**Sobre a oportunidade:**\n\n\n\nVocê irá atuar no desenvolvimento e manutenção de aplicações móveis para o setor financeiro, contribuindo diretamente para a evolução dos produtos de uma cooperativa de crédito.\n\n  \n\n\n**Você será responsável por:**\n\n\n* Desenvolver novas funcionalidades e manter as existentes em aplicações Flutter;\n* Garantir a qualidade, escalabilidade e performance das aplicações seguindo boas práticas de desenvolvimento;\n* Projetar e implementar soluções baseadas em Clean Architecture e princípios SOLID;\n* Trabalhar com injeção de dependências e gerenciadores de estado eficientes;\n* Escrever testes unitários e realizar TDD para garantir a confiabilidade do código;\n* Integrar APIs e serviços de terceiros de forma segura e eficiente;\n* Colaborar com equipes multidisciplinares, para entregar soluções robustas e inovadoras.\n\n  \n\n\n\n\n**O que você precisa ter:**\n\n\n* Experiência sólida com desenvolvimento Flutter, incluindo desenvolvimento de packages/plugins com integração nativa (MethodChannel);\n* Domínio de Clean Architecture e princípios SOLID;\n* Experiência com injeção de dependências (preferencialmente GetIt);\n* Conhecimento avançado em gerenciamento de estado com BLoC e Cubit;\n* Experiência com TDD e escrita de testes unitários;\n\n  \n\n\n**Conhecimentos desejáveis:**\n\n\n* Experiência com Mockito ou Mocktail para testes;\n* Conhecimento em ferramentas de análise estática de código, como SonarQube;\n* Experiência prévia com desenvolvimento nativo em Android (Kotlin/Java) ou iOS (Swift/Objective\\-C).\n\n  \n\n\n**Contratação Remota**\n\n\n**✨** **O que oferecemos:**\n\n\n* Cultura aberta a ideias, inovação e crescimento.\n* Foco na excelência das entregas e na geração de impacto.\n* Valorização do aprendizado contínuo e do desenvolvimento profissional.\n\n\n**✨** **Aqui temos:**\n\n  \n\n* Cartão Flash;\n* Plano de Saúde Unimed;\n* Inglês gratuito 2x por semana;\n* Convênio com clinica de saúde mental.\n\n\nConfira os motivos para trabalhar aqui\\>\\> https://conhecanossabase.premiersoft.net/\n\n\n\nSaiba mais sobre nós \\>\\> https://bit.ly/QuemsomosPremierSoft\n\n\n\n️ Conheça nossa Sede \\>\\> https://bit.ly/NossaSedePremiersoft\n\n\n\nA comunicação durante o processo seletivo pode ser feita por e\\-mail ou telefone. Sugerimos que você fique de olho em suas caixas de entrada de e\\-mail e defina a permissão para receber mensagens de @premiersoft.net para que nossas mensagens não sejam direcionadas para a caixa de spam ;)\n\n',
