    description:
      '**Vagas para quem quer** **transformar** **negócios e sua carreira!**\n---------------------------------------------------------------------\n\n### **Desejável**\n\n\nConhecimento em:\n• ExtJs.\n• Syncfusion.\n• Azure Functions.\n• Kubernetes.\n• Certificações Microsoft.### **Requisitos da vaga**\n\n\n• Arquiteturas MVC e CQRS.\n• C\\# (.Net Framework/Core) e Entity Framework.\n• Azure Service Bus (ou outras soluções de mensageria).\n• XUnit (ou outras ferramentas de testes unitários).\n• SQL Server.\n• ElasticSearch (ou outros bancos de dados NoSQL).\n• HTML, CSS, JavaScript, TypeScript e Angular.\n• Scrum (ou outras metodologias ágeis).\n• Git.\nConhecimento em:\n• StimulSoft Reports (ou outras ferramentas para criação de relatórios).\n• Microsoft Azure DevOps.\n• Habilidade para liderar tecnicamente projetos e mentorar membros da equipe.### **Suas atividades**\n\n\n• Desenvolver e manter produtos utilizando arquiteturas MVC e CQRS\n• Back\\-end: C\\# (.Net Framework/Core), Entity Framework, SQL Server, testes unitários (XUnit), ElasticSearch, Azure Service Bus, Azure.\n• Functions e StimulSoft Reports.\n• Front\\-end: HTML, CSS, JavaScript, TypeScript, ExtJs, Angular e Syncfusion\n• Liderança técnica em projetos, orientando e mentorando membros da equipe\n• Responsabilidade pela arquitetura de sistemas, garantindo escalabilidade,\nperformance e segurança.\n• Realização de code reviews e garantia da qualidade do código.\n• Participação ativa em cerimônias Scrum e contribuição para a melhoria contínua do processo.### **É importante te lembrar que ...**\n\n\nNa UDS contratamos pessoas competentes, com vontade de **transformar usando o seu conhecimento.**  \n\n  \n\n**Isso independe** da sua região, idade, etnia ou raça, religião, identidade de gênero ou orientação sexual.  \n\n  \n\nSeus conhecimentos são aderentes à vaga? **Isso é tudo** o que importa.  \n\n  \n\nSeu perfil e valores casam com os nossos? **Venha criar transformações com a gente.**',
