    description:
      '**Muito prazer, Somos a Evertec \\+ Sinqia!**\n\n  \n\nDiariamente, processamos bilhões de transações através dos nossos produtos, impactando diretamente a vida de muitos brasileiros. Estamos entre as 100 maiores Fintechs do mundo. Nossos(a) colaboradores(a) criam soluções relevantes, transmitem conhecimento com inteligência prezam pelo carisma ao agir e se comunicar.\n\n **Responsabilidades e atribuições**  \n\nA área de **Engenharia \\| Bancos** responsável por todo atendimento de clientes de bancários, desde a sustentação até customização, busca um(a) **Desenvolvedor PL \\| Java** para compor nosso time, na maior empresa de desenvolvimento de softwares e produtos para o mercado financeiro do Brasil, onde acreditamos que a inovação tecnológica inspira a evolução.\n\n **Esse cargo é responsável por:**\n\n* Realizar o desenvolvimento de aplicações em Java Back\\-end, escrevendo um código limpo e eficiente;\n* Análise de código SQL, para consultas, criação de procedures, views e otimização de banco de dados;\n* Realizar análise e manutenção de Sistemas Legados, especialmente em Delphi.\n\n **Requisitos e qualificações** **Para dar \\#match, essa vaga necessita que atenda alguns requisitos obrigatórios:**\n\n* Experiência com Java Sênior (v8, v11, v21\\);\n* Experiência com SQL Server (Procedures / Functions) para consultas, criação de procedures, views e otimização de banco de dados;\n* Vivência com Spring Framework (Microserviços), Spring ou Hibernate;\n* Conhecimento em Ferramentas CI/CD: Familiaridade com integração contínua (CI) / entrega contínua (CD), como Jenkins;\n* Familiaridade com controle de versão (Git) ou TFS;\n* Conhecimento em Maven e SonarQube;\n* Ensino Superior Completo.\n\n **Caso possua o conhecimento ou atuação abaixo, será um diferencial:**\n\n* Conhecimento no mercado financeiro, especificamente em crédito;\n* Vivência com Scrum e/ou Kanban;\n* Conhecimento em IA generativa;\n* Conhecimento em Delphi e linguagens legados.\n\n **IMPORTANTE**: Essa oportunidade é para atuar na Sinqia com foco em atender um dos nossos clientes, modalidade Remoto.\n\n **Informações adicionais**  \n\n**E ai, se identificou com o que leu até agora? Então, vou te contar o que você encontrará aqui, além de um ambiente dinâmico;**\n\n* Vale refeição ou alimentação;\n* Assistência médica;\n* Assistência Odontológica\n* Auxílio creche;\n* Benefícios Flexíveis (Flash);\n* Auxílio home office;\n* Gympass e TotalPass;\n* Horários flexíveis;\n* Seguro de vida;\n* Clube de parcerias;\n* Just dress no code (sem código de vestimenta!),\n* Day off no aniversário.\n\n  \n\nNa Sinqia valorizamos a diversidade e entendemos que o que acrescenta é justamente ideias e pontos de vistas variados. Por isso raça, cor, religião, gênero e identidade de gênero, nacionalidade, deficiência, orientação sexual, ascendência ou idade, não serão impeditivos de você fazer parte do nosso time.\n\n  \n\nSaiba mais sobre a Sinqia em: www.sinqia.com.br e siga os nossos perfis nas redes sociais.\n\n  \n\nLíder em softwares, inovação e uma das maiores provedoras de tecnologia e serviços para o setor financeiro. Oferecemos diversos softwares (Bancos, Fundos, Investimentos, Previdência, Consórcios e Meios de Pagamentos) e serviços (Outsourcing e consulting). Em constante crescimento, com mais de 20 aquisições e mais de 700 clientes, somos uma das empresas de tecnologia pioneiras.\n\n  \n\nSomos uma das empresas que mais crescem no Brasil e somos eleitos desde 2017 como uma das **100 maiores Fintechs do Mundo**, de acordo com o International Data Corporation (IDC).\n\n',
